int tot, pr[maxs], d[maxs], text[maxm][maxd];
inline int pow(int x, int k)
{
	int ret = 1;
	for( ; k > 0; k >>= 1, x = x * x)
		if(k & 1)
			ret = ret * x;
	return ret;
}
int T[maxl], S[maxl], F[maxl], PM[maxl];
int _rem[maxl], cp[maxe], cpm[maxe], s[maxe];
int solve(int L, int R, int m)
{
	if(L > R)
		return 0;
	int *pT = T - L, *pS = S - L, *pF = F - L, *pPM = PM - L, *rem = _rem - L;
	for(int i = L; i <= R; ++i)
	{
		pT[i] = pF[i] = 0;
		pS[i] = 1; // pPM[i] is not used
		rem[i] = i;
	}
	int lim = (int)ceil(sqrt(R)), o;
	for(o = 0; pr[o] <= lim; ++o)
		for(int pp = pr[o], j = R / pp * pp; j >= L; j -= pp)
			for(rem[j] /= pp; rem[j] % pp == 0; rem[j] /= pp);
	for(int i = L; i <= R; ++i)
	{
		if(rem[i] == 1)
		{
			rem[i] = i;
			continue;
		} // else p_t = rem[i], k_t = 1
		int pp = rem[i], cpm = pow(pp, m);
		pT[i] = pF[i] = 1;
		pS[i] = cpm + pp - 1;
		pPM[i] = cpm;
		rem[i] = i / rem[i];
	}
	while(--o >= 0)
	{
		int mx = 1, pp = pr[o], kk, sta = R / pp * pp;
		if(sta < L)
			continue;
		cp[0] = cpm[0] = s[0] = 1;
		cp[1] = pp;
		cpm[1] = pow(pp, m);
		s[1] = cpm[1] + pp - 1;
		for(int j = sta; j >= L; j -= pp)
		{
			bool chk = j == rem[j];
			for(kk = 1, rem[j] /= pp; rem[j] % pp == 0; ++kk, rem[j] /= pp);
			for( ; mx < kk; ++mx)
			{
				cp[mx + 1] = cp[mx] * pp;
				cpm[mx + 1] = cpm[mx] * cpm[1];
				s[mx + 1] = s[mx] * cpm[1] + cp[mx + 1] - cp[mx];
			}
			pT[j] = pT[j] * (cp[kk] - cp[kk - 1]) + pS[j] * s[kk - 1];
			pS[j] = pS[j] * s[kk];
			pF[j] = chk ? cpm[kk - 1] : pF[j] * pPM[j] * cpm[kk - 1];
			pPM[j] = cpm[1];
		}
	}
	int ret = 0;
	for(int i = L; i <= R; ++i)
		ret += (pT[i] << 1) - pF[i];
	return ret;
}
inline int solve(int n, int m)
{
	int idx = n / delta, low = idx * delta, upp = low + delta;
	return n - low <= upp - n ? text[m][idx] + solve(low + 1, n, m) : text[m][idx + 1] - solve(n + 1, upp, m);
}
int main()
{
	for(int i = 2; i < maxs; ++i)
	{
		if(!d[i])
			pr[tot++] = d[i] = i;
		for(int j = 0, k; (k = i * pr[j]) < maxs; ++j)
		{
			d[k] = pr[j];
			if(d[i] == pr[j])
				break;
		}
	}
	pr[tot] = ~0u >> 1; // INF
	const char *ptr = cipher;
	for(int i = 1; i < maxm; ++i)
		for(int j = 1; j < maxd; ++j)
			for(int k = 0; k < BLEN; ++k, ++ptr)
				text[i][j] = text[i][j] * BASE + (*ptr - STA - (*ptr > '\\'));
	int n, m;
	scanf("%d%d", &n, &m);
	printf("%u\n", solve(n, m));
	return 0;
}

